import axios from "axios";
import { useEffect, useState } from "react";
import { useParams } from "react-router";
import styled from "styled-components";
import Footer from "./Footer";
import Header from "./Header";
import ModalDate from "./ModalDate";
import logoDog from "../assets/imgs/dog-logo.png";
import logoCat from "../assets/imgs/cat-logo.png"

export default function PetInfo() {
  const [petInfo, setPetInfo] = useState([]);
  const [date, setDate] = useState("");
  const [modal, setModal] = useState(false);
  const { idPet } = useParams();
  const {idNature} = useParams();
  const URL = `http://localhost:4000/pet/get/${idNature}/${idPet}`;

  useEffect(() => {
    axios
      .get(URL)
      .then((response) => {
        const { data } = response;
        setPetInfo([data]);
        console.log("get pet ", data);
      })
      .catch((error) => {
        console.log(error.response); 
      });
  }, []);

  if (petInfo.length > 0) {
    const petArr = petInfo[0];
    const pet = petArr[0]
    console.log("pet data", petInfo)
    console.log("pet", pet)

    return pet.isDog ? (
      <>
        <Header />
        <Style>
          <div className="top">
            <h1>{pet.name}</h1>
            <div className="img-box">
              <img src={logoDog} />
            </div>
          </div>
          <div className="pet-info">
            <p>Breed: {pet.breed}</p>
            <p>Birthday: {pet.birthdate}</p>
            <p>Genre: {pet.genre}</p>
            <DogInfo>
              {" "}
              <div className="health-box">
                Vacinas:
                <div className="health">
                  <p>V8/V10</p>
                  <p>Data: {date} </p>
                  <label for="pet">
                    <input
                      onClick={() => setModal(!modal)}
                      type="radio"
                      id="pet"
                      className="radio-input"
                    ></input>

                  </label>
                </div>
                <div className="health">
                  <p>Antirábica</p>
                  <p>Data: {date} </p>
                  <label for="pet">
                    <input
                      onClick={() => setModal(!modal)}
                      type="radio"
                      id="pet"
                      className="radio-input"
                    ></input>

                  </label>
                </div>
                <div className="health">
                  <p>Gripe</p>
                  <p>Data: {date} </p>
                  <label for="pet">
                    <input
                      onClick={() => setModal(!modal)}
                      type="radio"
                      id="pet"
                      className="radio-input"
                    ></input>

                  </label>
                </div>
              </div>
              <ModalDate modal={modal} setModal={setModal} />
              <div className="health-box">
                Vermífugo:
                <div className="health">
                  <p>1° semestre</p>
                  <p>{date}</p>
                  <label for="verm1">
                    <input
                      onClick={() => setModal(!modal)}
                      type="radio"
                      id="verm1"
